                // 3. BASE TAGS (Styles & Medium)
                if (i.styles) i.styles.split(',').forEach(s => t.add(s.trim()));
                if (i.medium) t.add(i.medium);
                t.add('Contemporary Art');
                t.add('Modern');

                // 4. COLOR & THEME INFERENCE (from Title)
                const titleLower = titleForSearch.toLowerCase();
                
